import React, { useEffect, useState } from "react"
import { Table } from "antd"
import api from "../../services/api"

const Atendimentos = () => {
  const [pacientes, setPacientes] = useState([])
  useEffect(() => {
    api
      .get("entradas")
      .then((response) => setPacientes(response.data.list))
      .catch((res) => console.log("érr", res))
  }, [])

  const columns = [
    {
      title: "Paciente",
      dataIndex: "paciente",
      key: "paciente",
    },
    {
      title: "Age",
      dataIndex: "age",
      key: "age",
    },
    {
      title: "Address",
      dataIndex: "address",
      key: "address",
    },
  ]

  return <Table dataSource={pacientes} columns={columns} />
}

export default Atendimentos
